import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';

import HomePage from './'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Penn Buddy
        </p>
      </header>
      <Routes>
        <Route exact path="/home" element={<HomePage />} />
      </Routes>
    </div>
  );
}

export default App;
